import React, { useState } from "react";
import { useNavigate } from "react-router-dom";

const eventsByYear = {
  2025: [
    { name: "Mistrovstv칤 Evropy", date: "08/2025", hidden: false },
    { name: "Mistrovstv칤 캛R", date: "06/2025", hidden: false },
    { name: "GP Framar Praha", date: "05/2025", hidden: false }
  ],
  2024: [
    { name: "GP Brno Sprint", date: "06/2024", hidden: false },
  ],
};

const Home = () => {
  const navigate = useNavigate();
  const [selectedYear, setSelectedYear] = useState(
    Math.max(...Object.keys(eventsByYear).map(Number))
  );

  return (
    <div className="min-h-screen flex flex-col font-inter bg-gray-100">
      {/* 游댛 Horn칤 li코ta */}
      <header className="bg-mint-500 text-white text-center text-3xl font-bold py-4">
        Hello, Cycling World! 游뛊
      </header>

      {/* 游릭 Li코ta s roky */}
      <div className="bg-gray-700 text-white py-3 flex justify-center gap-4">
        {Object.keys(eventsByYear)
          .sort((a, b) => b - a) // 콎ad칤me od nejnov캩j코칤ho
          .map((year) => (
            <button
              key={year}
              onClick={() => setSelectedYear(Number(year))}
              className={`px-6 py-2 text-lg font-semibold rounded-lg transition duration-300 hover:bg-gray-600 ${
                selectedYear === Number(year) ? "underline" : ""
              }`}
            >
              {year}
            </button>
          ))}
      </div>

      {/* 游릭 Seznam event콢 */}
      <main className="flex-grow flex flex-col items-center p-6">
        <div className="w-full max-w-2xl text-center text-lg space-y-4">
          {eventsByYear[selectedYear]
            .filter((event) => !event.hidden) // Skryjeme eventy s hidden: true
            .map((event, index) => (
              <div
                key={index}
                className="bg-white shadow-lg rounded-lg p-4 cursor-pointer hover:bg-gray-200 transition duration-300"
                onClick={() => navigate(`/event/${event.name.replace(/\s+/g, "-").toLowerCase()}`)}
              >
                <span className="text-xl font-bold">{event.name}</span> - {event.date}
              </div>
            ))}
        </div>
      </main>

      {/* 游댵 Spodn칤 li코ta */}
      <footer className="bg-mint-500 text-white text-center text-lg py-2">
        Enjoy your ride!
      </footer>
    </div>
  );
};

export default Home;
